// LandingPage.js

import React from "react";
usesta
import "./LandingPage.css";

function LandingPage() {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    message: "",
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await fetch("/api/send-email", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(formData),
      });

      if (response.ok) {
        // Handle success, show a success message or redirect
        console.log("Message sent successfully!");
      } else {
        // Handle error, show an error message
        console.error("Error sending message");
      }
    } catch (error) {
      console.error("Error:", error);
    }
  };

  return (
    <div className="landing-page">
      <h1>Welcome to Our Project</h1>
      <p>
        This is a brief description of our project. You can provide details
        about the purpose, features, and goals of the project here.
      </p>

      <div className="divider"></div>

      <div className="developers-section">
        <h2>Meet Our Developers</h2>
        <div className="developers-row">
          <div className="developer">
            <img src="Yash.png" alt="Developer 1" />
            <p>Yash R. Balkhande</p>
          </div>
          <div className="developer">
            <img src="Gayatri.png" alt="Developer 2" />
            <p>Gayatri S. Bhamburkar</p>
          </div>
          <div className="developer">
            <img src="Shreyash.png" alt="Developer 3" />
            <p>Shreyash N. Waghmare</p>
          </div>
          <div className="developer">
            <img src="developer4.jpg" alt="Developer 4" />
            <p>Vedant P. Nehare</p>
          </div>
        </div>
      </div>

      <div className="divider"></div>

      <div className="about-us-section">
        <h2>About Us</h2>
        <p>
          Here you can provide a detailed description of your team, the project,
          and any other relevant information about your organization.
        </p>
      </div>

      <div className="divider"></div>

      <div className="contact-us-section">
        <h2>Contact Us</h2>
        <p>
          Feel free to reach out to us for any inquiries or feedback. You can
          provide your contact information or use the form below.
        </p>

        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label htmlFor="name">Name:</label>
            <input
              type="text"
              id="name"
              name="name"
              value={formData.name}
              onChange={handleChange}
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="email">Email:</label>
            <input
              type="email"
              id="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="message">Message:</label>
            <textarea
              id="message"
              name="message"
              value={formData.message}
              onChange={handleChange}
              required
            ></textarea>
          </div>

          <button type="submit">Send Message</button>
        </form>
      </div>
    </div>
  );
}

export default LandingPage;
